import { Link } from 'react-router-dom';
import './header.css';

export const AppleLogo = () => {
    return (
    <div>
        AppleStore
    </div>
    )
}

console.log(AppleLogo);

export const Header = () => {
  return (
    <div className='header'>
        <div className='wrapper'>
            <Link to="/" className='store-logo' element={ AppleLogo }/>
        </div>
        <div className='header-cart'>
            cart
        </div>
    </div>
  )
}
